import FeedbackPage from './FeedbackPage';
import { useNavigate } from 'react-router-dom';
const ProfilePage = () => {
    const user = {
        username: 'johndoe123',
        name: 'John Doe',
        email: 'john.doe@gmail.com',
        // password: 'password',
        contact: '123456789',
        country: 'India',
        feedback: ['Great work', 'Keep it up']
    }
    const navigate = useNavigate();

    function handleviewFeedBack(){
        navigate(`/profile/${user.username}/feedback`, {state: {'feedback' : user.feedback}});
    }

    return(
    <>
        <h2>User Details</h2>
        <form>
            <label>Name: </label>
            <input type="text" value={user.name ? user.name : ''} /><br />
            <label>Username: </label>
            <input type="text" value={user.username} disabled/><br />
            <label>Email: </label>
            <input type="email" value={user.email} disabled/><br />
            <label>Contact: </label>
            <input type="number" value={user.contact? user.contact: ''} /><br />
            <label>Country: </label>
            <input type="text" value={user.country} /><br />
            <button onClick={handleviewFeedBack}>View FeedBacks</button>
        </form>
    </>
    )
}

export default ProfilePage;
